webpackJsonp([97289616006364],{1467:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2007-06-22-social-software-is-for-the-young/index.md absPath of file >>> MarkdownRemark",html:'<p><a href="http://www.businessweek.com/magazine/content/07_24/b4038405.htm">An interesting study by business week shows who is doing what on line</a>. The visualization helps to show what is in many ways obvious - young people are more likely to do social things online.</p>\n<p>I don\'t think this is bad.</p>\n<p>I think it means that over the next decade social software is going to become more pervasive. There are a lot of successes in the Web 2.0 space right now, but I think they are only the beginning. Future tools will help us communicate and collaborate in a global way.</p>',frontmatter:{title:"Social Software is for the Young",date:"June 22, 2007",imageUrl:null,image:null}}},pathContext:{path:"/social-software-is-for-the-young"}}}});
